__NUXT_JSONP__("/boten/raptor", (function(a,b){return {data:[{story:{name:"Raptor",created_at:"2021-05-04T18:26:39.666Z",published_at:"2021-05-04T18:37:02.727Z",alternates:[],id:48699874,uuid:"ef80ca5f-17e8-47bb-a75b-cf4382fa862d",content:{_uid:"c189e3e4-412f-43f6-b567-368636a56914",titel:"D&Ø Raptor",images:[{id:2282040,alt:a,name:b,focus:a,title:a,filename:"https:\u002F\u002Fa.storyblok.com\u002Ff\u002F106943\u002F1024x683\u002Fef95fa67ec\u002F11a.jpeg",copyright:a},{id:2282041,alt:a,name:b,focus:a,title:a,filename:"https:\u002F\u002Fa.storyblok.com\u002Ff\u002F106943\u002F848x480\u002Fcb19bdc36e\u002F11b.jpeg",copyright:a},{id:2282042,alt:a,name:b,focus:a,title:a,filename:"https:\u002F\u002Fa.storyblok.com\u002Ff\u002F106943\u002F4608x3456\u002F968f3510db\u002F11c.JPG",copyright:a}],component:"boten",thumbnail:"\u002F\u002Fa.storyblok.com\u002Ff\u002F106943\u002F1024x683\u002Fee5040d17f\u002F11a.jpeg",uitvoering:"**Uitvoeringen:**\n\n* 650\n* 750\n* 900\n* 900 Kajuit",beschrijving:"**Een no-nonsens sloep met een opvliegend karakter**  \nDe D&Ø Raptor is een echte blikvanger op het water. Geïnspireerd op de klassieke reddingsboot heeft de D&Ø Raptor een stoere en robuuste uitstraling. De standaard matzwart geleverde D&Ø Raptor is een ware blikvanger op het water!\n\n**Planerend**  \nDe D&Ø Raptor is de planerende versie van de D&Ø Crafter. Hierdoor vaart de sloep niet meer ‘door’ het water maar ‘over’ het water en voelt het alsof de sloep over het water vliegt. Een planerende sloep veroorzaakt weinig waterverplaatsing en zal daarom voor andere boten geen noemenswaardige zuiging veroorzaken. Dit is een hele prettige bijkomstigheid voor sloepen die vooral op binnenwater varen.\n\n**100% aluminium, 100% onderhoudsvrij**  \nDe D&Ø Raptor is gemaakt van zeewaterbestendig aluminium met een legering van 4,5 ALMG en een dikte van 5 mm. Deze combinatie levert het ideale materiaal voor een onderhoudsvrije boot.\n\n**Zelflozend**  \nDe D&Ø Raptor is volledig zelflozend. Dit betekent dat de boot niet afgedekt hoeft te worden. Het opbergen van de kussens in de afsluitbare opbergruimtes onder de banken en het zonnedek is voldoende.\n\n**Veelzijdig en gebruiksvriendelijk**  \nDe D&Ø Raptor is een hele veelzijdige sloep met de mogelijkheid om erop te kunnen slapen wanneer u kiest voor de uitvoering met kajuit. Hij is uitermate geschikt voor een feestje met vrienden of een heerlijk ontspannen dag met het hele gezin. De sloep is in alle opzichten gemakkelijk in gebruik.",specificaties:"volgt nog",calltoaction_text:"Wilt uw eens voelen hoe een sloep met power vaart?\nVraag hier uw proefvaart aan",korte_beschrijving:"**Stoer, stijlvol en no-nonsense,**  \ndat zijn de kenmerken van de Davy&Ørsted, een nieuwe generatie reddingsloepen, geheel gemaakt van aluminium. De sloep is zelflozend en 100% onderhoudsvrij."},slug:"raptor",full_slug:"boten\u002Fraptor",default_full_slug:a,sort_by_date:a,position:-60,tag_list:[],is_startpage:false,parent_id:43882559,meta_data:a,group_id:"3741d5e3-5394-45b7-a3f4-aece62a00646",first_published_at:"2021-05-04T18:27:52.000Z",release_id:a,lang:"default",path:a,translated_slugs:[]}}],fetch:{},mutations:[]}}(null,"")));